import React from "react";
import Wyniki from "./components/Form/wyniki";
import NewForm from "./components/Form/Form";

function App() {
  return (
    <div>
      <div>
      <Card>
        <NewForm onSaveDate={Wyniki} />
      </Card>
      </div>
      <div>
        <Wyniki />
      </div>
    </div>
  );
}

export default App;
